import React from 'react'
import styled from 'styled-components'

const StyledCover = styled.div`
    font-size: 2rem;
    width: 100%;
    height: 7rem;
    border: 1px solid var(--color-border);

    ${props => props.content} {
        display: none;
    }
`

const Cover = ({ title, children }) => {
    return (
        <StyledCover content = {children}>
                { title }
                { children }
        </StyledCover>
    )
}

export default Cover
